        />

        <CardProject
          image= { image }
          react= {reactLogo}
          scss={scssLogo}
          node={nodeLogo}
          javaScript={javaScipt}
          ror= {rorLogo}
          reduxLogo={reduxLogo}
          mongoLogo={mongoLogo}
        />

        <CardProject
          image= { image }
          react= {reactLogo}
          scss={scssLogo}
          node={nodeLogo}
          javaScript={javaScipt}
          ror= {rorLogo}
          reduxLogo={reduxLogo}
          mongoLogo={mongoLogo}
        />

        <CardProject
          image= { image }
          react= {reactLogo}
          scss={scssLogo}
          node={nodeLogo}
          javaScript={javaScipt}
          ror= {rorLogo}
          reduxLogo={reduxLogo}
          mongoLogo={mongoLogo}
        />
      </div>
    </div>
  )
}

export default Folio
